import React from "react";

export const IndPost = ({post}) => {

    return post 
    ?<div>
        <p>
            <strong>{post.title}</strong> 
            <br/>
             {post.description}
             <br/>
             {post.price} 
             <br/>
             <em>{post.location}</em>
        </p>
    </div>    
    : 'Loading Posts...'

}

// export default IndPost;
